-- ----------------------------
-- View structure for v_book_basic_info
-- ----------------------------
DROP VIEW IF EXISTS `v_book_basic_info`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_book_basic_info` AS select `b`.`BookID` AS `BookID`,`b`.`Title` AS `Title`,`b`.`Publisher` AS `Publisher`,`b`.`Price` AS `Price`,`b`.`StockQuantity` AS `StockQuantity` from `book` `b`;

-- ----------------------------
-- View structure for v_book_detail
-- ----------------------------
DROP VIEW IF EXISTS `v_book_detail`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_book_detail` AS select `b`.`BookID` AS `BookID`,`b`.`Title` AS `Title`,`b`.`Publisher` AS `Publisher`,`b`.`Price` AS `Price`,group_concat(distinct `a`.`Name` order by `ba`.`AuthorOrder` ASC separator ', ') AS `Authors`,group_concat(distinct `k`.`Word` separator ', ') AS `Keywords`,`b`.`StockQuantity` AS `StockQuantity` from ((((`book` `b` left join `bookauthor` `ba` on((`b`.`BookID` = `ba`.`BookID`))) left join `author` `a` on((`ba`.`AuthorID` = `a`.`AuthorID`))) left join `bookkeyword` `bk` on((`b`.`BookID` = `bk`.`BookID`))) left join `keyword` `k` on((`bk`.`KeywordID` = `k`.`KeywordID`))) group by `b`.`BookID`;

-- ----------------------------
-- View structure for v_customer_info
-- ----------------------------
DROP VIEW IF EXISTS `v_customer_info`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_customer_info` AS select `customer`.`CustomerID` AS `CustomerID`,`customer`.`Name` AS `Name`,`customer`.`Address` AS `Address`,`customer`.`Balance` AS `Balance`,`customer`.`CreditLevel` AS `CreditLevel` from `customer`;

-- ----------------------------
-- View structure for v_customer_orders
-- ----------------------------
